spring:  jmx:    enabled: false  redis:    host: '@redis.host@'    port: '@redis.port@'  rabbitmq:    host: '@rabbitmq.host@'  cloud:    nacos:      server-addr: '@nacos.url@'      discovery:        username: '@nacos.username@'        password: '@nacos.password@'jwt:  secret: '@jwt.secret@'file:  locations:    disk:      storage-path: /home/uploadfile/      url-mapping: /files/public/    disk-protected:      storage-path: /home/uploadfile/protected/      url-mapping: /files/protected/logging:  file:    path: /logs    max-history: 30